import React, { Component } from 'react';
import { connect } from 'react-redux';
import * as action from './actions';

class App extends Component {
  render() {
    console.log(this.props)
    const obj = this.props.state

    console.log(obj.pet.variables.health)
    let tempWidth = 30
    return (
      <div className="App">
      <h2>Stats</h2>
      <p>Pet name: {obj.constants.petName}</p>
      <p>Owner name: {obj.constants.userName}</p>
      <div>
        Health
        <div className="bar" style={{width: '100px', height: '5px', backgroundColor: 'powderblue'}} />
        <div className="bar" style={{width: {tempWidth}, height: '5px', backgroundColor: 'powderblue'}} />
      </div>

      <div>
        Inventory
      </div>

      </div>
    );
  }
}

const mapStateToProps = (state) => {
  return {
    state
  }
}

export default connect(mapStateToProps)(App);
